  \"2015-12-20T19:00:15.496406\",\n\t\"name\": \"meteorological-biological-and-hydrographic-data-collected-from-middle-bay-lighthouse-in-mobile-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Abstract: Dauphin Island Sea Lab and the
  Mobile Bay National Estuary Program have partnered with the University of South
  Alabama, the Alabama Department of Conservation, State Land Division, Coastal Program,
  the Environmental Protection Agency's Gulf of Mexico Program and the Alabama Lighthouse
  Association to provide real-time wave and current data from Middle Bay Lighthouse
  in Mobile Bay, AL. Near real-time data are available in a user-friendly format at
  www.mymobilebay.com. Informative pop-ups describe each parameter and graphs of each
  may be displayed for the visitor to the website. Researchers may download the data
  in a spreadsheet format for further analysis.nnPurpose: The value of coastal observing
  systems is recognized by the U.S. Congress, the National Ocean Partnership Program,
  the Environmental Protection Agency, and the National Ocean and Atmospheric Administration.
  Recent reports by the Pew Oceans Commission and U.S. Commission on Ocean Policy
  have decried the lack of information from near coastal waters on which to base management
  decisions and recommended monitoring programs linked to strong research. Reasons
  for continuous, real-time observations of meteorological and hydrographic parameters
  include (1) continuous characterization of spatial and temporal patterns of change
  in water quality, (2) development of a permanent record of significant and human
  caused changes in environmental indicators over time, and (3) support for research
  activities through the availability of consistent, scientifically valid data. An
  additional benefit of real-time observation is the potential for the public to track
  and learn about water quality conditions. Many coastal dwellers are uninformed about
  conditions in nearby estuaries because they do not have access to current information
  about parameters such as water temperature, salinity, dissolved oxygen levels and
  water level and they may fail to appreciate the complexity of interactions in estuarine
  ecosystems.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
